//Edhaya Login

import React, { useState } from "react";

import './Component.css';
import { Link, useHistory } from 'react-router-dom';
import EmployeeService from '../services/EmployeeService';
const Login = () => {

    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const history = useHistory();
    const employeeLogin = { username, password };
    const HandleSubmit = (e) => {
        e.preventDefault();
        EmployeeService.login(employeeLogin).then((response) => {

            if (response.data.position === "Admin") {
                history.push("/employees");

            }
            else {

                console.log("Logged in by : " + response.data.position);

                history.push("/view-employee/" + response.data.id);
            }
        }).catch(error => {
            console.log(error);
        })

    }

    return (
        <div>

            <form id="form" className="form form-login">

                <label className="col-sm-4" className="form-control-sm form-label">EmployeeCode</label>
                <input className="col-sm-6" className="form-control-sm form-input" type="text" value={username} onChange={(e) => setUsername(e.target.value)} />

                <label className="col-sm-4" className="form-control-sm form-label">Password</label>
                <input className="col-sm-6" className="form-control-sm form-input" type="password" value={password} onChange={(e) => setPassword(e.target.value)}
                 />
                <div className="mt-3" >
                    <center><Link className="btn btn-info" onClick={(e) => HandleSubmit(e)} to="" >Submit</Link></center>
                </div>
       
            </form >  
        </div >

);

};

export default Login;
